import React from 'react';
import CartProduct from './CartProduct'

const CartList = ({ sentCart }) => {

    return (
        <div class="list-group">
            { sentCart.map((product) => (
                <>
                <CartProduct 
                    product={product}
                />
                <br />
                </>
            ))}
        </div>
    )
}

export default CartList;
